,\"id\":170641,\"released\":\"2014-06-21 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-locations\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/locations\\/\",\"changelog\":\"<h4>v2.02 - September 11, 2017<\\/h4>\\n<ul>\\n<li>Fix: Remove invalid city data.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - May 10, 2016<\\/h4>\\n<ul>\\n<li>Switch to using Lookup fields<\\/li>\\n<li>Add a link to reset the locations data<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 14, 2015<\\/h4>\\n<ul>\\n<li>Add options to import specific location groups<\\/li>\\n<li>Import with Ajax instead of page reloading<\\/li>\\n<li>No more annoying banners<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - August 18, 2015<\\/h4>\\n<ul>\\n<li>Add options to import specific locations<\\/li>\\n<li> Import with Ajax instead of page reloading<\\/li>\\n<li>No more annoying banners<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - June 21, 2014<\\/h4>\\n<ul>\\n<li>Fix parse error affecting some users <\\/li>\\n<li>This now requires at least v1.07.05 of Formidable<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-locations\\/us_locations.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/locations.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"11927748\":{\"title\":\"Logs\",\"name\":\"Logs\",\"slug\":\"logs\",\"version\":\"1.0b1\",\"new_version\":\"1.0b1\",\"location\":[\"fp.strategy11.com\\/releases\\/logs\\/formidable-logs-1.0b1.zip\"],\"excerpt\":\"See your API requests along with their responses from add-ons including Zapier, Formidable API Webhooks, Salesforce and more.\",\"id\":11927748,\"released\":\"2016-12-19 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/logs\\/\",\"changelog\":\"\",\"plugin\":\"formidable-logs\\/formidable-logs.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170655\":{\"title\":\"MailChimp\",\"name\":\"MailChimp\",\"slug\":\"mailchimp\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-mailchimp\\/formidable-mailchimp-2.03.zip\"],\"excerpt\":\"Get on the path to more sales and leads in a matter of minutes. Add leads to a MailChimp mailing list when they submit forms and update their information along with the entry.\",\"id\":170655,\"released\":\"2013-10-17 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-mailchimp\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailchimp\\/\",\"changelog\":\"<h4>v2.03 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add option to unsubscribe users.<\\/li>\\n<li>Enhancement: Automatically update subscriber if their email exists in the selected MailChimp list.<\\/li>\\n<li>Enhancement: Remove files and functions deprecated since version 2.0.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 12, 2017<\\/h4>\\n<ul>\\n<li>New: Allow Formidable Address fields to be mapped to MailChimp Address fields.<\\/li>\\n<li>Enhancement: Increase limit to 50 for group options retrieved.<\\/li>\\n<li>Enhancement: Initialize database on initial install.<\\/li>\\n<li>Enhancement: Add basic PHP error log messages for failed subscription.<\\/li>\\n<li>Fix: Don\'t generate PHP error if a timeout occurs when fetching group options.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - March 30, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Increase merge and group limit to 30<\\/li>\\n<li>Fix: Improve date compatibility between MailChimp and Formidable<\\/li>\\n<li>Fix: Allow groups to be used when running free version of Formidable<\\/li>\\n<li>Fix: Store MailChimp settings as array, rather than object, in database<\\/li>\\n<\\/ul>\\n<h4>v2.0 - December 16, 2016<\\/h4>\\n<ul>\\n<li>Enhancement: Add pot file for more easily adding translations<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - November 8, 2016<\\/h4>\\n<ul>\\n<li>Enhancement: Add compatibility with MailChimp API 3.0<\\/li>\\n<li>Enhancement: Migrate any old settings to actions<\\/li>\\n<li>Enhancement: When importing a form, migrate old settings to actions<\\/li>\\n<li>Enhancement: Add Update Now button to migrate old settings<\\/li>\\n<li>Enhancement: Increase minimum version to Formidable 2.0<\\/li>\\n<li>Enhancement: Load minimal hooks if Formidable is not compatible<\\/li>\\n<li>Fixed: Make sure editing entry updates MailChimp record<\\/li>\\n<li>Fixed: Fix passing numeric separate values to MailChimp\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailchimp\\/formidable-mailchimp.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/mailchimp.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20781560\":{\"title\":\"MailPoet Newsletters\",\"name\":\"MailPoet Newsletters\",\"slug\":\"mailpoet-newsletters\",\"version\":\"1.01\",\"new_version\":\"1.01\",\"location\":[\"fp.strategy11.com\\/releases\\/mailpoet\\/formidable-mailpoet-1.01.zip\"],\"excerpt\":\"Send WordPress newsletters from your own site with MailPoet. And use Formidable to for your newsletter signup forms.\",\"id\":20781560,\"released\":\"2018-06-05 00:00:00\",\"categories\":[\"Creator\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/mailpoet-newsletter-signup-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailpoet-newsletters\\/\",\"changelog\":\"\",\"plugin\":\"formidable-mailpoet\\/formidable-mailpoet.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163255\":{\"title\":\"Math Captcha\",\"name\":\"Math Captcha\",\"slug\":\"math-captcha\",\"version\":\"1.15\",\"new_version\":\"1.15\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-math-captcha\\/formidable-math-captcha-1.15.zip\"],\"excerpt\":\"\",\"id\":163255,\"released\":\"2015-10-12 14:00:35\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/math-captcha\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"172715\":{\"title\":\"PayPal Basic\",\"name\":\"PayPal Basic\",\"slug\":\"paypal-standard-single-payments\",\"version\":\"3.08\",\"new_version\":\"3.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.08.zip\"],\"excerpt\":\"\",\"id\":172715,\"released\":\"2015-10-21 12:20:35\",\"categories\":[\"Ecommerce\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard-single-payments\\/\",\"changelog\":\"<h4>v3.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Merge the older grandfathered PayPal addon with the updated version.<\\/li>\\n<\\/ul>\\n<h4>v2.04.07 - January 25, 2015<\\/h4>\\n<ul>\\n<li>Allow amounts with . for thousands and , for decimal. If a . is used in the decimal place for the amount when the currency uses a , make it work anyway<\\/li>\\n<li>Redirect to PayPal correctly without Pro<\\/li>\\n<li>Make sure email setting is trimmed before comparing<\\/li>\\n<li>Add download ID to make sure correct license is used<\\/li>\\n<\\/ul>\\n<h4>v2.04.06 - November 17, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when updating Formidable<\\/li>\\n<\\/ul>\\n<h4>v2.04.05<\\/h4>\\n<ul>\\n<li>Format decimals with . to allow float to work correctly<\\/li>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v2.04.04<\\/h4>\\n<ul>\\n<li>Allow the amount to be included in the \\\"other\\\" option<\\/li>\\n<li>Modify the user-agent in the IPN verification to prevent errors from PayPal<\\/li>\\n<\\/ul>\\n<h4>v2.04.03<\\/h4>\\n<ul>\\n<li>Save the IPN parameters with the payment in the format that allows for multiple IPN notifications<\\/li>\\n<li>Fix sending users to Paypal when 2.x is installed, but the old settings haven\'t been moved to a form action<\\/li>\\n<li>Increased security related to XSS add_query_arg vulnerability<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163257\":{\"title\":\"PayPal Standard\",\"name\":\"PayPal Standard\",\"slug\":\"paypal-standard\",\"version\":\"3.08\",\"new_version\":\"3.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.08.zip\"],\"excerpt\":\"PayPal order forms collect instant payments and recurring payments to automate your online business. Collect information, calculate a total, and send them on to PayPal.\",\"id\":163257,\"released\":\"2012-09-04 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-paypal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard\\/\",\"changelog\":\"<h4>v3.08 - November 18, 2017<\\/h4>\\n<ul>\\n<li>Allow field shortcodes in more payments settings so values can be set from the form: PayPal email, trial amount, repeat period, trial length. This also allows payments to go to other members on your site.<\\/li>\\n<li>Allow regular WordPress shortcodes and Formidable dynamic values (ie [email]) in addition to basic field shortcodes<\\/li>\\n<\\/ul>\\n<h4>v3.07 - November 10, 2017<\\/h4>\\n<ul>\\n<li>Process shortcodes in after payment settings. Allow entry values, default values, and other shortcodes.<\\/li>\\n<li>Clarify the payment trigger options with \\\"Successful PayPal payment\\\"<\\/li>\\n<\\/ul>\\n<h4>v3.06.01 - October 12, 2017<\\/h4>\\n<ul>\\n<li>New: Add Paypal triggers to API action.<\\/li>\\n<li>Fix: Show update notice for administrators only.<\\/li>\\n<li>Fix: Add missing close select tag in global settings.<\\/li>\\n<\\/ul>\\n<h4>v3.06 - December 9, 2016<\\/h4>\\n<ul>\\n<li>New: Add Paypal trigger to registration action for the registration 2.0 release<\\/li>\\n<li>Tweak: Don\'t add columns to entries when there is no form. This is in preparation for Formidable v2.03<\\/li>\\n<li>Tweak: If the log file setting is empty, fill it with the default setting<\\/li>\\n<li>Fix: Show correct values in the \\\"paid\\\" column on the Entries listing page if no payments have been made<\\/li>\\n<li>Fix: Add a fallback if invoice is missing from the IPN. This will help payments get matched up if the id of the payment doesn\'t get sent back to your site.<\\/li>\\n<li>Fix: Payment expiration dates are showing in 1970<\\/li>\\n<\\/ul>\\n<h4>v3.05 - August 5, 2016<\\/h4>\\n<ul>\\n<li>Fix IPN validation for sandbox<\\/li>\\n<li>Make sure &amp; is always used in the PayPal url on all servers<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-paypal\\/formidable-paypal.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/formidable\\/PayPal-form-action.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"209561\":{\"title\":\"Polylang\",\"name\":\"Polylang\",\"slug\":\"polylang\",\"version\":\"1.07\",\"new_version\":\"1.07\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-polylang\\/formidable-polylang-1.07.zip\"],\"excerpt\":\"Create bilingual or multilingual forms with help from Polylang.\",\"id\":209561,\"released\":\"2016-01-22 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-polylang\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/polylang\\/\",\"changelog\":\"<h4>v1.07 - February 8, 2018<\\/h4>\\n<ul>\\n<li>Add rootline titles to translation settings<\\/li>\\n<li>Make repeating fields translatable<\\/li>\\n<li>Fix error message when no languages have been added in Polylang<\\/li>\\n<\\/ul>\\n<h4>v1.06 - December 8, 2016<\\/h4>\\n<ul>\\n<li>Fix: Adjusted the way form strings are saved in wp_options table to resolve packet size error.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - May 24, 2016<\\/h4>\\n<ul>\\n<li>Improve compatibility with Polylang 1.9+<\\/li>\\n<\\/ul>\\n<h4>v1.04 - February 11, 2016<\\/h4>\\n<ul>\\n<li>Translate Add and Remove buttons for repeating sections<\\/li>\\n<li>Clear original strings whenever a form is updated instead of only when the translation page is visited<\\/li>\\n<\\/ul>\\n<h4>v1.03 - February 2, 2016<\\/h4>\\n<ul>\\n<li>Show a more helpful message if Polylang isn\'t installed<\\/li>\\n<li>Translate values from confirmation fields<\\/li>\\n<li>Use the \\\"previous\\\" label from the settings instead of defaulting to \\\"Previous\\\"<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-polylang\\/frm-poly.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20815759\":{\"title\":\"Quiz Maker\",\"name\":\"Quiz Maker\",\"slug\":\"quiz-maker\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/quiz\\/formidable-quizzes-1.0.zip\"],\"excerpt\":\"The Quiz Maker plugin for WordPress turns your forms into automated quizzes. Add questions including a quiz field, submit an entry as the quiz key, and publish the quiz on a page. Then all the grading is done for you.\",\"id\":20815759,\"released\":\"2018-09-13 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/quiz-maker-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/quiz-maker\\/\",\"changelog\":\"\",\"plugin\":\"formidable-quizzes\\/formidable-quizzes.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20266559\":{\"title\":\"Salesforce\",\"name\":\"Salesforce\",\"slug\":\"salesforce\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/salesforce\\/formidable-salesforce-2.03.zip\"],\"excerpt\":\"Add new contacts and leads into your Salesforce CRM directly from the WordPress forms on your site.\",\"id\":20266559,\"released\":\"2018-05-31 00:00:00\",\"categories\":[\"CRM\",\"Elite\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/salesforce-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/salesforce\\/\",\"changelog\":\"<h4>v2.03 - October 11, 2018<\\/h4>\\n<ul>\\n<li>New: Add option to update Salesforce records<\\/li>\\n<li>New: Add support for Salesforce Boolean fields<\\/li>\\n<li>Fix: Multiselect picklist fields weren\'t getting correct values from a checkbox<\\/li>\\n<li>Fix: Date fields set as a post field were sending the wrong date format<\\/li>\\n<li>Fix: Fatal error caused by date fields in certain formats<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 14, 2018<\\/h4>\\n<ul>\\n<li>Add API calls to <a href=\\\"https:\\/\\/formidableforms.com\\/downloads\\/logs\\/\\\">Logs plugin<\\/a><\\/li>\\n<li>Add more messages for debugging<\\/li>\\n<li>Fix issue with authenticating on an SSL site<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-salesforce\\/formidable-salesforce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163248\":{\"title\":\"Signature\",\"name\":\"Signature\",\"slug\":\"signature\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-signature\\/formidable-signature-2.02.zip\"],\"excerpt\":\"Add an electronic signature to your WordPress form. The visitor may write their signature with a trackpad\\/mouse or type it.\",\"id\":163248,\"released\":\"2013-03-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-signature\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/signature\\/\",\"changelog\":\"<h4>v2.02 - January 30, 2019<\\/h4>\\n<ul>\\n<li>Fix: Show the signature correctly in views and emails when Pro is running<\\/li>\\n<\\/ul>\\n<h4>v2.01 - January 16, 2019<\\/h4>\\n<ul>\\n<li>New: Give the signature field a face lift and show the field in the builder<\\/li>\\n<li>New: Show the typed option by default when javascript fails instead of showing nothing<\\/li>\\n<li>New: Don\'t clear the typed box when switching tabs<\\/li>\\n<li>Fix: The signature wasn\'t showing correctly in an email<\\/li>\\n<li>Fix: The signature field wasn\'t appearing for in-place edit<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 14, 2019<\\/h4>\\n<ul>\\n<li>New: The signature value immediately creates the image when the signature is saved and saves the url of the image for easier display. On update, all previous signatures are updated to the new format saved in the database.<\\/li>\\n<li>New: Add signature support for ajax forms and repeating sections.<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML.<\\/li>\\n<li>New: Use the 3.0 field object for better forward compatibility and lower baseline memory.<\\/li>\\n<li>New: Requires Formidable 3.0+<\\/li>\\n<li>New: Combine scripts into one file, and don\'t load IE8 fallback script in all browsers.<\\/li>\\n<li>New: Keep drawn signature when switching pages and when there are form validation errors.<\\/li>\\n<li>New: Allow signature editing in single-page form until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Prevent error message when Formidable is disabled<\\/li>\\n<li>Fix: Show the signature image with https when needed<\\/li>\\n<li>Fix: The hide tabs options weren\'t saving since v3.0<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - December 7, 2017<\\/h4>\\n<ul>\\n<li>New: Add signature support with ajax forms and repeating sections<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML<\\/li>\\n<li>Fix: Keep drawn signature when switching pages.<\\/li>\\n<li>Fix: Keep drawn signature present when there are form errors.<\\/li>\\n<li>Fix: Allow signature editing until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Resolve error message when Formidable is disabled<\\/li>\\n<\\/ul>\\n<h4>v1.12b1 - October 20, 2017<\\/h4>\\n<ul>\\n<li>New: Allow importing from URL.<\\/li>\\n<li>Fix: Keep drawn signature when switching pages.<\\/li>\\n<li>Fix: Keep drawn signature present when there are form errors.<\\/li>\\n<li>Fix: Allow signature editing until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"1.16\",\"new_version\":\"1.16\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-1.16.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v1.16 - November 6, 2018<\\/h4>\\n<ul>\\n<li>New: Set a trial period based on a form field. The field must include a number for the number of days for the trial.<\\/li>\\n<li>Fix: Subscriptions with trial were skipping the trial on new Stripe API versions<\\/li>\\n<li>Fix: When viewing a subscription on the Formidable -&gt; Payments page, show the correct interval when it is greater than 1 (ie every 2 months).<\\/li>\\n<li>Fix: If Stripe is only one payment gateway, show all the Stripe fields in the form settings before the form action is saved.<\\/li>\\n<li>Update PO file for translations<\\/li>\\n<\\/ul>\\n<h4>v1.15 - May 30, 2018<\\/h4>\\n<ul>\\n<li>Add a payment status of \'authorized\' and a link to capture an authorized payment. When a charge is captured, the status is automatically changed to complete.<\\/li>\\n<li>Add hooks for frm_stripe_error_code and frm_stripe_error_messages<\\/li>\\n<li>Add frm_pay_[payment type]_sidebar hook for adding content to the sidebar of a single payment<\\/li>\\n<li>Add log message when plan creation fails<\\/li>\\n<li>If locale is English, return the message from Stripe. This gives us better error messages.<\\/li>\\n<li>Add Swedish and Norwegian translations<\\/li>\\n<li>Fix: No plan errors for accounts using the current API version. Use the older API version for creating plans<\\/li>\\n<li>Fix: Canceled subscriptions were triggering successful payment triggers<\\/li>\\n<\\/ul>\\n<h4>v1.14 - February 15, 2018<\\/h4>\\n<ul>\\n<li>New: Add support for cancelation triggers<\\/li>\\n<li>New: Add support for cancelation from your Stripe account at Stripe.com<\\/li>\\n<li>Fix: Prevent errors submitting draft entry. Combined with Formidable v3.0, payments can now be made in forms that allow saving drafts.<\\/li>\\n<li>Fix: The older submit button HTML was causing a disabled button with javascript validation when the card passed validation, but other fields on the page did not.<\\/li>\\n<\\/ul>\\n<h4>v1.13 - December 4, 2017<\\/h4>\\n<ul>\\n<li>Process shortcodes in the payment amount, description, and actions after payment. This includes default values, field values, and regular WP shortcodes.<\\/li>\\n<li>Add better failure messages in place of \\\"There was an error processing your payment\\\"<\\/li>\\n<li>Include the cacert fallback<\\/li>\\n<li>Add South African Rand as currency option<\\/li>\\n<li>Update js to prevent deprecated js notice in 3.0<\\/li>\\n<li>Use credit card icon instead of Stripe. This will show in 3.0.<\\/li>\\n<\\/ul>\\n<h4>v1.12 - August 17, 2017<\\/h4>\\n<ul>\\n<li>Make card error messages translatable http:\\/\\/translate.strategy11.com\\/glotpress\\/projects\\/formidable-stripe\\/<\\/li>\\n<li>Add frm-stripe-cards shortcode. This shortcode shows cards on the customer Stripe account and allows them to be removed. This will be used in v2.0 with the option to reuse an existing card.<\\/li>\\n<li>If the first Stripe form action returns an error message, don\'t run the next Stripe action<\\/li>\\n<li>Delete entries that don\'t pass credit card validation<\\/li>\\n<li>Create the post (if applicable) before fields are updated<\\/li>\\n<li>If PayPal is also installed, show the PayPal payment completed status<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"slug\":\"twilio\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.08.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - November 1, 2016<\\/h4>\\n<ul>\\n<li>When an SMS message is received, run validation and respond with a text that includes any error messages<\\/li>\\n<li>When a text is received successfully, respond with the form success message, filtered list like a form does.<\\/li>\\n<li>Allow for the \\\"other\\\" fields to be filled from a text submission<\\/li>\\n<li>Check if license number is for correct plugin<\\/li>\\n<li>Don\'t try to send messages to a blank number<\\/li>\\n<\\/ul>\\n<h4>v1.06 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_format_number filter for formatting the phone number before it\'s sent to Twilio<\\/li>\\n<li>Fix license activation<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_sms_response hook for changing the message in the text<\\/li>\\n<li>Allow for 8-digit numbers. +65 phone numbers were having trouble because we assumed they should be US numbers. Now if the number starts with a +, don\'t add the +1<\\/li>\\n<li>Get updates from FormidableForms.com<\\/li>\\n<\\/ul>\\n<h4>v1.04 - September 11, 2015<\\/h4>\\n<ul>\\n<li>Fix error with accepting votes<\\/li>\\n<li>Send a response when a text vote is received<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-upload-importer\\/formidable-upload-importer-1.0.01.zip\"],\"excerpt\":\"\",\"id\":168456,\"released\":\"2015-10-16 17:05:47\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/upload-importer\\/\",\"changelog\":\"<h4>v1.0.01<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0<\\/h4>\\n<ul>\\n<li>Allow importing of multiple file uploads<\\/li>\\n<li>Replace deprecated mime_content_type with fileinfo<\\/li>\\n<li>Update auto-updating<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"173984\":{\"title\":\"User Registration\",\"name\":\"User Registration\",\"slug\":\"user-registration\",\"version\":\"2.02.01\",\"new_version\":\"2.02.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-registration\\/formidable-registration-2.02.01.zip\"],\"excerpt\":\"Give new users access to your site as quickly and painlessly as possible. Allow users to register, edit and be able to login to their profiles on your site from the front end in a clean, customized registration form.\",\"id\":173984,\"released\":\"2011-12-21 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/user-registration\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-registration\\/\",\"changelog\":\"<h4>v2.02.01 - September 26, 2018<\\/h4>\\n<ul>\\n<li>Allow user profile updating to be triggered after a successful PayPal payment<\\/li>\\n<li>Fix: Show a blank form to logged in users who have permission to create other users, even if they have an entry in the form<\\/li>\\n<li>New: Added frmreg_allow_edit hook for other plugins to set when profile editing is allowed<\\/li>\\n<\\/ul>\\n<h4>v2.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>New: Get the page source to check if the page includes the form specified in the global settings (login form, reset password, or registration). This allows for these forms to be included in a sidebar or footer without returning error messages when the global settings are saved.<\\/li>\\n<li>New: Add hooks to change selected pages: frmreg_login_page_id, frmreg_resetpass_page_id, frmreg_register_page_id<\\/li>\\n<li>New: Allow a subsite to be created by a logged in user<\\/li>\\n<li>Fix: Allow user creation via API call<\\/li>\\n<li>Fix: Allow either set password by email or user moderation, but not both<\\/li>\\n<li>Fix: Issue with losing parameters when redirecting for login<\\/li>\\n<li>Fix: The user ID field was defaulting to the current user on registration forms when it should be empty<\\/li>\\n<li>Fix: If an error message is included in the url for password reset, show it instead of an unknown error<\\/li>\\n<li>Fix: Update for WP 3.9 compatibility<\\/li>\\n<li>Fix: Update for deprecated functions: save_settings, FrmForm::get_id_by_key, FrmProFieldsHelper::get_displayed_file_html<\\/li>\\n<li>New: Add Chinese translations<\\/li>\\n<\\/ul>\\n<h4>v2.01.01 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add frmreg_after_create_subsite action.<\\/li>\\n<li>New: Add Norwegian translation.<\\/li>\\n<li>New: Add frmreg_login_error filter.<\\/li>\\n<li>Fix: Make sure show lost password and layout settings apply to widget.<\\/li>\\n<li>Fix: Convert special characters to standard characters in subdomain.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - October 4, 2017<\\/h4>\\n<ul>\\n<li>New: Add global registration page setting.<\\/li>\\n<li>Enhancement: Allow radio and select fields for display name.<\\/li>\\n<li>Enhancement: Change field label in lost password form.<\\/li>\\n<li>Enhancement: Show hidden field type in Subdirectory or Subdomain settings.<\\/li>\\n<li>Enhancement: Always allow administrators to edit profiles through registration form.<\\/li>\\n<li>Enhancement: Redirect to login page if activation link is clicked again after activation.<\\/li>\\n<li>Fix: Show error messages in reset password form.<\\/li>\\n<li>Fix: Set logout label parameter correctly in shortcode builder.<\\/li>\\n<li>Fix: Passwords with special characters not saving as expected.<\\/li>\\n<\\/ul>\\n<h4>v2.0.01 - July 31, 2017<\\/h4>\\n<ul>\\n<li>Fix: Sliding login form in IE and Edge<\\/li>\\n<li>Fix: Set the login form and reset password form action the same way WordPress does<\\/li>\\n<li>Fix: Include lostpassword_form action in lost password form<\\/li>\\n<li>Fix: Allow HTML in login error messages<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-registration\\/formidable-registration.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170649\":{\"title\":\"User Tracking\",\"name\":\"User Tracking\",\"slug\":\"user-tracking\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-user-tracking\\/formidable-user-tracking-1.0.zip\"],\"excerpt\":\"Track which pages a user visits prior to submitting a form.\",\"id\":170649,\"released\":\"2015-10-19 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-user-tracking\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-tracking\\/\",\"changelog\":\"<h4>v1.0 - August 25, 2016<\\/h4>\\n<ul>\\n<li>Save the tracking info before the email is sent<\\/li>\\n<li>Make sure license key is correct before saving<\\/li>\\n<\\/ul>\\n<h4>v1.0b3<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0b2<\\/h4>\\n<ul>\\n<li>Skip tracking wp-admin\\/ajax.php<\\/li>\\n<li>Remove base url from page list<\\/li>\\n<li>Codestyling to meet WP standards<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-user-tracking\\/formidable-user-tracking.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"174006\":{\"title\":\"WooCommerce\",\"name\":\"WooCommerce\",\"slug\":\"woocommerce\",\"version\":\"1.07\",\"new_version\":\"1.07\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-woocommerce\\/formidable-woocommerce-1.07.zip\"],\"excerpt\":\"Are your WooCommerce product forms too basic? Add custom fields to a WooCommerce product form and collect more data when a product is added to the cart.\",\"id\":174006,\"released\":\"2016-01-19 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-woocommerce\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/woocommerce\\/\",\"changelog\":\"<p>There are no views with that ID<\\/p>\\n\",\"plugin\":\"formidable-woocommerce\\/formidable-woocommerce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"169998\":{\"title\":\"WP Multilingual\",\"name\":\"WP Multilingual\",\"slug\":\"wp-multilingual\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-wpml\\/formidable-wpml-1.06.zip\"],\"excerpt\":\"Translate your forms into multiple languages using the Formidable-integrated WPML plugin.\",\"id\":169998,\"released\":\"2013-04-29 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-multi-language\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/wp-multilingual\\/\",\"changelog\":\"<h4>v1.04 - October 25th, 2016<\\/h4>\\n<ul>\\n<li>Allow translation of Add\\/Remove buttons<\\/li>\\n<li>Replace some deprecated WPML function calls and constants<\\/li>\\n<li>Make sure wpml strings are updated when form is updated<\\/li>\\n<li>Do not translate default value for all field types<\\/li>\\n<li>Make sure incorrect field message is translated with ajax submit<\\/li>\\n<\\/ul>\\n<h4>v1.03.03 - March 28, 2016<\\/h4>\\n<ul>\\n<li>Send the language in the ajax url differently to prevent 404s during ajax calls. This should help with duplicate submissions.<\\/li>\\n<li>Prevent a license key from being saved for another plugin<\\/li>\\n<\\/ul>\\n<h4>v1.03.02<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<li>Fix errors when Formidable or WPML are deactivated<\\/li>\\n<li>Include the current language during ajax calls<\\/li>\\n<li>Force an English start language for strings for v2.2.6 of the WPML strings plugin<\\/li>\\n<li>Fix the issue with the default language in WPML being set different than the string language<\\/li>\\n<li>If values in the form settings page changed, update them when going to the translation settings<\\/li>\\n<li>Make sure the \\\"previous\\\" label is translatable when drafts are not enabled<\\/li>\\n<li>Don\'t show strings for inactive languages<\\/li>\\n<li>Translate fields in repeating sections<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-wpml\\/formidable-wpml.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170645\":{\"title\":\"Zapier\",\"name\":\"Zapier\",\"slug\":\"zapier\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-zapier\\/formidable-zapier-1.06.zip\"],\"excerpt\":\"Connect with hundreds of different applications through Zapier. Insert a new row in a Google docs spreadsheet, post on Twitter, or add a new Dropbox file with your form.\",\"id\":170645,\"released\":\"2014-06-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-zapier\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/zapier\\/\",\"changelog\":\"<h4>v1.06 - February 6, 2019<\\/h4>\\n<ul>\\n<li>Add a new fallback for authentication with the API key in the url. When the API key continues to say it is missing, add add_filter( \'frm_zap_url_auth\', \'__return_true\' ); in the theme functions.php.<br \\/>\\nThen use this url in Zapier:<br \\/>\\nhttps:\\/\\/yoursite.com\\/API-KEY-GOES-HERE\\/\\n<\\/li>\\n<li>New: Add frm_zap_sent hook to run after an entry is sent to Zapier<\\/li>\\n<li>Fix: Don\'t send draft entries to Zapier<\\/li>\\n<li>Added automation to release new versions<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 31, 2018<\\/h4>\\n<ul>\\n<li>New: Add frmzap_entry_array filter to customize the entry values sent to Zapier<\\/li>\\n<li>New: Add logging of Zapier responses into the Logs addon<\\/li>\\n<li>Fix: Prevent a blank response when fetching the list of forms. This was happening on some sites with a lot of forms<\\/li>\\n<\\/ul>\\n<h4>v1.04 - July 31, 2017<\\/h4>\\n<p>Fix a conflict with API keys between the Zapier and API addons on a multisite network. This solves the issue with the incorrect API key error message in Zapier.<\\/p>\\n<h4>v1.03 - June 5, 2017<\\/h4>\\n<ul>\\n<li>Allow field ids to be used in Zapier mapping instead of only field keys<\\/li>\\n<li>Increase the limit of triggered zaps per form from 5 to 40<\\/li>\\n<li>Fix overloaded property error when setting the user for authentication<\\/li>\\n<li>Prevent error reporting during API calls so the response is formatted correctly<\\/li>\\n<\\/ul>\\n<h4>v1.02 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent error when Formidable is disabled<\\/li>\\n<li>Use static classes for fields and forms<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-zapier\\/formidable-zapier.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}}}\";}', 'no');
